import React from 'react';
import {
  Box,
  ModalBody,
  Button,
  Link,
  useColorModeValue,
  Heading,
  Code,
} from '@chakra-ui/react';
import { BsPlay, BsFileEarmarkCode } from 'react-icons/bs';

const Linter = props => {
  const firstColor = useColorModeValue('red', 'yellow');
  return (
    <Box mt={2} {...props}>
      <ModalBody>
        <Button
          leftIcon={<BsPlay />}
          colorScheme={firstColor}
          size="lg"
          mr={5}
          disabled={true}
        >
          <Link
            as="a"
            _hover={{ textDecor: 'none' }}
            href="https://github.com/sumantguha/Java-Style-Checker"
            isExternal={true}
          >
            Try Now (Coming Soon!)
          </Link>
        </Button>
        <Button leftIcon={<BsFileEarmarkCode />} colorScheme="blue" size="lg">
          <Link
            as="a"
            _hover={{ textDecor: 'none' }}
            href="https://github.com/sumantguha/Java-Style-Checker"
            isExternal={true}
          >
            View Source Code
          </Link>
        </Button>
        <br />
        <br />
        <Heading display="inline-block" mr={2} size="sm">
          Development Frameworks:
        </Heading>
        <Code children="Python" mr={2} />
        <Code children="React.js" mr={2} />
        <Code children="Flask" mr={2} />
        <br />
        <Heading display="inline-block" mr={2} size="sm">
          Design Frameworks:
        </Heading>
        <Code children="Figma" />
        <br />
        <br />
      </ModalBody>
    </Box>
  );
};

export default Linter;
